import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import AuthProvider from './context/AuthContext';
import Header from './components/Header/Header';
import Home from './pages/Home';
import About from './pages/About';
import Admissions from './pages/Admissions';
import Academics from './pages/Academics'; // Updated import
import ProgramDetail from './pages/Academics'; // Added import
import CurriculumDetail from './pages/Academics'; // Added import
import FacultyDetail from './pages/Academics'; // Added import
import AllFaculty from './pages/Academics'; // Added import
import ResourceDetail from './pages/Academics'; // Added import
import Contact from './pages/Contact';
import MyAccount from './pages/MyAccount';
import Profile from './pages/Profile';
import Settings from './pages/Settings';
import Grades from './pages/Grades';
import Logout from './pages/Logout';
import Login from './pages/Login';
import Signup from './pages/Signup';
import ProtectedRoute from './components/ProtectedRoute';

function App() {
  return (
    <AuthProvider>
      <Router>
        <Header />
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/logout" element={<Logout />} />

          {/* Protected Routes */}
          <Route
            path="/"
            element={
              <ProtectedRoute>
                <Home />
              </ProtectedRoute>
            }
          />
          <Route
            path="/about"
            element={
              <ProtectedRoute>
                <About />
              </ProtectedRoute>
            }
          />
          <Route
            path="/admissions"
            element={
              <ProtectedRoute>
                <Admissions />
              </ProtectedRoute>
            }
          />
          <Route
            path="/academics"
            element={
              <ProtectedRoute>
                <Academics />
              </ProtectedRoute>
            }
          />
          <Route
            path="/academics/program/:id"
            element={
              <ProtectedRoute>
                <ProgramDetail />
              </ProtectedRoute>
            }
          />
          <Route
            path="/academics/curriculum/:grade"
            element={
              <ProtectedRoute>
                <CurriculumDetail />
              </ProtectedRoute>
            }
          />
          <Route
            path="/academics/faculty"
            element={
              <ProtectedRoute>
                <AllFaculty />
              </ProtectedRoute>
            }
          />
          <Route
            path="/academics/faculty/:id"
            element={
              <ProtectedRoute>
                <FacultyDetail />
              </ProtectedRoute>
            }
          />
          <Route
            path="/academics/resource/:resource"
            element={
              <ProtectedRoute>
                <ResourceDetail />
              </ProtectedRoute>
            }
          />
          <Route
            path="/contact"
            element={
              <ProtectedRoute>
                <Contact />
              </ProtectedRoute>
            }
          />
          <Route
            path="/my-account"
            element={
              <ProtectedRoute>
                <MyAccount />
              </ProtectedRoute>
            }
          />
          <Route
            path="/profile"
            element={
              <ProtectedRoute>
                <Profile />
              </ProtectedRoute>
            }
          />
          <Route
            path="/settings"
            element={
              <ProtectedRoute>
                <Settings />
              </ProtectedRoute>
            }
          />
          <Route
            path="/grades"
            element={
              <ProtectedRoute>
                <Grades />
              </ProtectedRoute>
            }
          />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
